import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div style={{ 
        padding: '20px', 
        textAlign: 'center', 
        backgroundColor: 'lightgreen',
        minHeight: '100vh',
        fontFamily: 'Arial, sans-serif'
      }}>
        <h1 style={{ color: '#2c3e50' }}>IT Support System</h1>
        <p style={{ color: 'green', fontSize: '18px', fontWeight: 'bold' }}>
          ‚úÖ React Router Test - Navigation Should Work!
        </p>
        
        {/* Navigation */}
        <nav style={{ 
          margin: '20px 0', 
          padding: '10px',
          backgroundColor: '#2c3e50',
          borderRadius: '5px'
        }}>
          <Link 
            to="/" 
            style={{ color: 'white', margin: '0 15px', textDecoration: 'none' }}
          >
            Home
          </Link>
          <Link 
            to="/login" 
            style={{ color: 'white', margin: '0 15px', textDecoration: 'none' }}
          >
            Login
          </Link>
          <Link 
            to="/register" 
            style={{ color: 'white', margin: '0 15px', textDecoration: 'none' }}
          >
            Register
          </Link>
        </nav>

        {/* Routes */}
        <Routes>
          <Route path="/" element={
            <div style={{ padding: '20px', backgroundColor: 'white', borderRadius: '5px' }}>
              <h2>üè† Home Page</h2>
              <p>Welcome to the IT Support System!</p>
            </div>
          } />
          <Route path="/login" element={
            <div style={{ padding: '20px', backgroundColor: 'white', borderRadius: '5px' }}>
              <h2>üîê Login Page</h2>
              <p>Login form will go here</p>
            </div>
          } />
          <Route path="/register" element={
            <div style={{ padding: '20px', backgroundColor: 'white', borderRadius: '5px' }}>
              <h2>üìù Register Page</h2>
              <p>Registration form will go here</p>
            </div>
          } />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
